<template>
    <div id="map" class="rounded-lg"></div>
</template>

<script setup>
const props = defineProps({
    invStores: {
        type: Object,
        default: {}
    },
    invShifts: {
        type: Object,
        default: {}
    }
})
const { invShifts, invStores } = toRefs(props)

const initMap = () => {
    const map = new google.maps.Map(document.getElementById("map"), {
        zoom: 9,
        zoomControl: true,
        scrollwheel: true,
        disableDefaultUI: true,
        styles: mapLayoutStyles,
        disableDoubleClickZoom: false,
        center: { lat: 51.70950856388891, lng: -0.39710360738896805 },
    });

    const bounds = new google.maps.LatLngBounds();
    const infoWindow = new google.maps.InfoWindow({ maxWidth: 300 });

    // map.fitBounds(bounds);

    // Store data with id | name | address | location [Need data from API]
    const stores = invStores.value;
    // Inventory Shifts (from & to are using stores array keys) [Need data from API]
    const inventoryShifts = invShifts.value;
    // Render store markers
    stores.forEach(store => {
        let markersData = new google.maps.Marker({
            position: store.position,
            map,
            title: store.name,
            icon: {
                url: "https://cdn-icons-png.flaticon.com/512/3028/3028580.png",
                origin: new google.maps.Point(0, 0),
                // size: new google.maps.Size(512, 512),
                anchor: new google.maps.Point(20, 20),
                scaledSize: new google.maps.Size(40, 40),
            }
        });

        markersData.addListener("click", () => {
            let iwContent = `<p><strong>Stock Status: </strong><span>${store.stockStatus}</span></p>
            <p><strong>${store.stock[0]}: </strong><span>${store.stock[1]}</span></p>
            <p><strong>Position: </strong><span>Latitude: ${store.position.lat.toFixed(4)} Longitude: ${store.position.lng.toFixed(4)}</span></p>`;
            infoWindow.setContent(iwContent);
            infoWindow.setHeaderContent(store.name);
            infoWindow.open(map, markersData);
        });

        bounds.extend(markersData.getPosition());
    });

    // Draw inventory shift lines with labels
    inventoryShifts.forEach(shift => {
        new google.maps.Polyline({
            path: [
                stores[shift.from].position,
                stores[shift.to].position,
            ],
            strokeColor: "#e20a03",
            strokeOpacity: 0.8,
            strokeWeight: 3,
            map,
            icons: [
                {
                    icon: {
                        path: google.maps.SymbolPath.FORWARD_CLOSED_ARROW,
                        scale: 4,
                        strokeColor: "#e20a03",
                        fillColor: "#e20a03",
                        fillOpacity: 0.8,
                    },
                    offset: "25%",
                },
                {
                    icon: {
                        path: google.maps.SymbolPath.FORWARD_CLOSED_ARROW,
                        scale: 4,
                        strokeColor: "#e20a03",
                        fillColor: "#e20a03",
                        fillOpacity: 0.8,
                    },
                    offset: "75%",
                },
            ]
        });

        const midpoint = {
            lat: (stores[shift.from].position.lat + stores[shift.to].position.lat) / 2,
            lng: (stores[shift.from].position.lng + stores[shift.to].position.lng) / 2,
        };

        new google.maps.Marker({
            position: midpoint,
            map,
            icon: {
                url: `data:image/svg+xml;charset=UTF-8,${encodeURIComponent(truckIconSvgString.replace("__inv_shift__", shift.count))}`,
                origin: new google.maps.Point(0, 0),
                size: new google.maps.Size(512, 512),
                anchor: new google.maps.Point(20, 20),
                scaledSize: new google.maps.Size(40, 40),
            }
        });
    });

    map.fitBounds(bounds);
}

onMounted(async () => {
    const { $googleMaps } = useNuxtApp();
    const google = await $googleMaps.load();
    initMap();
});
